const Home = () => {
    let backurl = "https://www.ionos.co.uk/digitalguide/fileadmin/DigitalGuide/Teaser/instagram-fuer-unternehmen-t.jpg";
    return (
        <div style={{ position: 'relative', opacity: '0.9' }}>
            <img src={backurl} style={{ width: '100%', height: '100%', objectFit: 'cover' }} alt="Background" />
            <div style={{ position: 'absolute', top: 0, left: 0, color: 'black', fontSize: '16px', background: 'white' }}>
                Keep your memories close
            </div>
            <div class="card">
                <h5 class="card-header">Featured</h5>
                <div class="card-body">
                    <h5 class="card-title">Special title treatment</h5>
                    <p class="card-text">With supporting text below as a natural lead-in to additional content.</p>
                    <a href="#" class="btn btn-primary">Go somewhere</a>
                </div>
            </div>
        </div>
    )
}
export default Home;
